import React from 'react';
import { ar, er } from '../../../redux/dr.js';
import Dialog from '../Dialog';
debugger;
let DialogF = (props) => {
  let state = props.store.getState();

  let AddF = (e) => {
    props.store.dispatch(ar());
  };

  let onchmsgF = (texts) => {
    let ac = er(texts);
    state.dispatch(ac);
  };

  return (
    <Dialog
      AddF={AddF}
      onchmsgF={onchmsgF}
      person={state.myPage.person}
      messages={state.myPage.messages}
      newmsg={state.myPage.newmsg}
    />
  );
};

export default DialogF;
